import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ConsultarViajes() {
  const [viajes, setViajes] = useState([]);
  const [comentarios, setComentarios] = useState([]);
  const [busqueda, setBusqueda] = useState('');
  const [resultadoBusqueda, setResultadoBusqueda] = useState([]);

  useEffect(() => {
    fetchViajes();
    fetchComentarios();
  }, []);

  const fetchViajes = async () => {
    const response = await axios.get('http://localhost:3001/api/viajes');
    setViajes(response.data);
  };

  const fetchComentarios = async () => {
    const response = await axios.get('http://localhost:3001/api/comentarios');
    setComentarios(response.data);
  };

  const buscarViaje = async () => {
    const response = await axios.get(`http://localhost:3001/api/viajes/${busqueda}`);
    setResultadoBusqueda(response.data);
  };

  const eliminarViaje = async (id) => {
    await axios.delete(`http://localhost:3001/api/viajes/${id}`);
    fetchViajes();
  };

  const eliminarComentario = async (id) => {
    await axios.delete(`http://localhost:3001/api/comentarios/${id}`);
    fetchComentarios();
  };

  return (
    <div>
      <div>
        <h2>Buscar Viaje</h2>
        <input
          type="text"
          placeholder="Buscar por país"
          value={busqueda}
          onChange={(e) => setBusqueda(e.target.value)}
        />
        <button onClick={buscarViaje}>Buscar</button>
        <table>
          <thead>
            <tr>
              <th>Pais</th>
              <th>Duración</th>
              <th>Costos</th>
              <th>Km Recorridos</th>
              <th>Mes</th>
              <th>Año</th>
              <th>Acciones</th>
            </tr>
          </thead>
          <tbody>
            {resultadoBusqueda.map((viaje) => (
              <tr key={viaje.id}>
                <td>{viaje.pais}</td>
                <td>{viaje.duracion}</td>
                <td>{viaje.costos}</td>
                <td>{viaje.km_recorridos}</td>
                <td>{viaje.mes}</td>
                <td>{viaje.anio}</td>
                <td>
                  <button onClick={() => eliminarViaje(viaje.id)}>Eliminar</button>
                  <button>Modificar</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div>
        <h2>Comentarios</h2>
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3, 1fr)', gap: '10px' }}>
          {comentarios.map((comentario) => (
            <div key={comentario._id}>
              <p>Pais: {comentario.pais}</p>
              <p>Comentario: {comentario.comentario}</p>
              <button onClick={() => eliminarComentario(comentario._id)}>Eliminar</button>
              <button>Modificar</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default ConsultarViajes;
